#
# Source for procedure pro_copy_Node2
#

DROP PROCEDURE IF EXISTS `pro_copy_Node2`;
CREATE DEFINER=`root`@`%` PROCEDURE `pro_copy_Node2`(
 in pro_new_contentID    Varchar(128),
 in pro_source_contentID Varchar(128)
)
Begin
declare done INT DEFAULT 0;  
declare v_tablename varchar(128);
declare v_orderno varchar(128);
declare cur CURSOR for SELECT table_name FROM INFORMATION_SCHEMA.TABLES where table_schema='?' and table_name LIKE '_|_%' ESCAPE '|';
declare cur_no CURSOR for select max(orderno)+1 from node n,(select parent_id,name from node where pkid = pro_source_contentID) pn where n.parent_id=pn.parent_id and n.name=pn.name;
DECLARE CONTINUE HANDLER FOR  not found  SET done = 1;
	open cur;
    repeat
    fetch cur into v_tablename;
    if not done then
        set @sql=concat('insert into ',v_tablename,'(node_id,value,vindex,length) select ','''',pro_new_contentID,'''',' ,x.Value,x.vindex,x.length FROM ',v_tablename, ' x where x.node_id','=''',pro_source_contentID,'''');
        prepare stmt from @sql;
        execute stmt;        
        deallocate prepare stmt;        
   End if;
   UNTIL done  END REPEAT;
   Close cur;      
   open cur_no;   
   fetch cur_no into v_orderno;
    Select pro_new_contentID,n.definition, n.parent_id, n.Name,n.type, v_orderno
      From node n
     Where n.pkid = pro_source_contentID;
  commit;  
  Close cur_no; 
end;

#
# Source for procedure pro_count_new
#

DROP PROCEDURE IF EXISTS `pro_count_new`;
CREATE DEFINER=`root`@`%` PROCEDURE `pro_count_new`()
BEGIN
set @pro_delete_sql :=  'truncate table  realtime_count';
set @pro_delete1_sql := 'truncate table  diary_count';
set @pro_delete2_sql := 'truncate table  monthly_count';
set @pro_delete3_sql := 'truncate table  weekly_count';
set @pro_delete4_sql := 'truncate table  quarterly_count';
set @pro_delete5_sql := 'truncate table  yearly_count';
prepare stmt1  from @pro_delete1_sql;
prepare stmt2  from @pro_delete2_sql;
prepare stmt3  from @pro_delete3_sql;
prepare stmt4  from @pro_delete4_sql;
prepare stmt5  from @pro_delete5_sql;
EXECUTE  stmt1;
EXECUTE  stmt2;
EXECUTE  stmt3;
EXECUTE  stmt4;
EXECUTE  stmt5;
deallocate prepare stmt1;
deallocate prepare stmt2;
deallocate prepare stmt3;
deallocate prepare stmt4;
deallocate prepare stmt5;

select sum(t.sumvalue),
             t.name,
             date_format(access_time,'%Y-%m-%e')
        from realtime_count t
       group by date_format(access_time,'%Y-%m-%e'), t.name;       

prepare stmt from @pro_delete_sql;
EXECUTE  stmt;
deallocate prepare stmt;

      select sum(t.sumvalue),
             t.name,
             MONTH(t.access_date),
             YEAR(t.access_date)
        from diary_count t
        group by t.name,MONTH(t.access_date),YEAR(t.access_date);
                
commit;
insert
      into weekly_count (sumvalue, name, access_week, access_year)
      select sum(t.sumvalue),
             t.name,
             WEEKOFYEAR(t.access_date),
                YEAR(t.access_date)
        from diary_count t
       group by t.name,
                WEEKOFYEAR(t.access_date),
                YEAR(t.access_date);

insert
      into quarterly_count (sumvalue, NAME, ACCESS_QUARTER, ACCESS_YEAR)
      select sum(t.sumvalue),
             t.name,
             CEILING(t.access_month / 3),
             t.access_year
        from monthly_count t
       group by t.name, CEILING(t.access_month / 3), t.access_year;

insert
      into yearly_count (sumvalue, name, access_year)
      select sum(t.sumvalue), t.name, t.ACCESS_YEAR
        from quarterly_count t
       group by t.name, t.ACCESS_YEAR;   
commit;
end;

#
# Source for procedure pro_delete_Node2
#

DROP PROCEDURE IF EXISTS `pro_delete_Node2`;
CREATE DEFINER=`root`@`%` PROCEDURE `pro_delete_Node2`( in ID Varchar(128))
BEGIN
  declare   cur_NodeID  varchar(128);    
  declare   resources_NodeID  varchar(128);  
  declare   v_tablename varchar(32);
  declare   done INT DEFAULT 0;  
  declare   sqlres text;    
  declare   resource text;
  call recursive_select('node','pkid','parent_id',ID,null,'pkid',sqlres);
  drop table if exists coolink_node_tab;
  CREATE TEMPORARY TABLE coolink_node_tab(pkid varchar(128))  TYPE = HEAP;  
  set @sql=CONCAT(' insert into coolink_node_tab select pkid from node where pkid IN(',sqlres,')');
  PREPARE stmt FROM @sql;
  EXECUTE stmt;
  DEALLOCATE PREPARE stmt;
 begin 
   declare cur_tablenames CURSOR for SELECT table_name FROM INFORMATION_SCHEMA.TABLES where table_schema='?' and table_name LIKE '_|_%' ESCAPE '|';
   declare cur_id  Cursor  for  select pkid from coolink_node_tab;   
   declare cur_resources  Cursor  for  select pkid from coolink_node_resources;
     
   DECLARE CONTINUE HANDLER FOR  not found  SET done = 1;
   Open cur_id;          
   REPEAT 
   Fetch cur_id Into cur_NodeID;
   If not done then   
   open cur_tablenames;   
   REPEAT
    FETCH cur_tablenames INTO v_tablename;
	if not done then
    if(instr(v_tablename,'r_')=1) then    
    set @v_sql=concat('delete from ',v_tablename,' where node_id','=''',cur_NodeID,''' or value','=''',cur_NodeID,'''');    
    else     
    if(instr(v_tablename,'p_')=1) then        
    call recursive_select('node','parent_id','pkid',NULL,cur_NodeID,'parent_id',resource);
    drop table  if exists coolink_node_resources; 
    CREATE TEMPORARY TABLE coolink_node_resources(pkid varchar(128))  TYPE = HEAP;   
    set @sql=concat(' insert into coolink_node_resources  select pkid  
			from node n, 
			(select value,count(1) as n from ',v_tablename,' where value in (select value from ',v_tablename,' where node_id=''',cur_NodeID,''' ) group by value) t 
			where t.n = 1
			and n.name = substr(t.value, LOCATE(','''/''',',t.value,2) + 1) 
			and n.parent_id = 
			(select pkid from node 
			where parent_id = 
			(select pkid from node where pkid in (',resource,') and parent_id=','''root''',' and type=1) 
			and name = ','''resources''',')');
    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;        
    open cur_resources;   
    REPEAT
    FETCH cur_resources INTO resources_NodeID;
	if not done then
    Delete From node Where pkid = resources_NodeID;
    Delete From i_resource_content Where node_id = resources_NodeID;
    Delete From s_mime Where node_id = resources_NodeID;
    Delete From d_createdTime Where node_id = resources_NodeID;
    Delete From l_length  Where node_id = resources_NodeID;
    End if;    
    UNTIL done  END REPEAT;
    Close cur_resources;   
    SET done = 0;
    drop table  if exists coolink_node_resources;
    End if;
    set @v_sql=concat('delete from ',v_tablename,' where node_id','=''',cur_NodeID,'''');    
    End if;
    PREPARE stmtv FROM @v_sql;
    EXECUTE stmtv;
    DEALLOCATE PREPARE stmtv;
    End if;
    UNTIL done  END REPEAT;
    Close cur_tablenames;   
    SET done = 0;    
    Delete From node  Where pkid = cur_NodeID;
   End If;
   UNTIL done  END REPEAT;
   Close cur_id;
   DROP TABLE IF EXISTS coolink_node_tab;
 end;
 commit;
 END;


