#
# Source for procedure pro_propertyDefinition
#

DROP PROCEDURE IF EXISTS `pro_propertyDefinition`;
CREATE DEFINER=`root`@`%` PROCEDURE `pro_propertyDefinition`()
BEGIN
#整理property_definition中不完整的属性
#步骤1 遍历node_definition
#步骤2 对superid不为空的加载其父大纲的属性 有一次遍历
Declare definitionID  varchar(128);
Declare property  varchar(128);
Declare superID  varchar(128);
Declare pro_num decimal(22,0);
declare done INT DEFAULT 0;
BEGIN
   Declare c1 Cursor  for Select n.pkid,n.super_id From node_definition n  Where n.super_id Is Not Null;
   declare c2 Cursor  for select pkid from property_empty_tab;   
   DECLARE CONTINUE HANDLER FOR  not found  SET done = 1;   
   Open c1;
   REPEAT 
   Fetch c1 Into definitionID,superID;
   If not done then      
    set @sql=CONCAT(' insert into property_empty_tab select pkid from property_definition where node_definition_id','=''',superID,'''');
    drop table  if exists property_empty_tab;
    CREATE TEMPORARY TABLE property_empty_tab(pkid varchar(256))  TYPE = HEAP;
    PREPARE stmt FROM @sql;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
    Open c2;          
    REPEAT  
    Fetch c2 Into property;
    if not done then
     Select Count(*) into pro_num From property_definition r Where r.pkid =property And r.node_definition_id =definitionID;
     If(pro_num=0) then
     Select D.PKID,definitionID,D.NAME,d.multiple,d.min_length,d.max_length,d.type,d.orderno,d.description,d.editor_type,d.enum_entry,d.reference_type,'0',d.read_only,d.Node_Type
     From property_definition d
     Where d.pkid =property And d.node_definition_id =superID;
     End If;   
    End if;
    UNTIL done END REPEAT;
    DROP TABLE IF EXISTS property_empty_tab;   
    Close c2;
    SET done = 0;   
   End If;
   UNTIL done END REPEAT;
   Close c1;
END;
END;

