	set @v_sql=concat('insert into coolink_orderno(pkid,orderno) select n.pkid, n.orderno from node n where n.parent_id = ''',pro_parent_id,''' and n.name = ''',replace(pro_name,'''',''''''),''' and type=1 order by n.orderno');
	prepare stmt from @v_sql;
