    deallocate prepare stmt; 	
	open cur_no;
    repeat
	   fetch cur_no into pro_pkid,pro_rn;
	if not done then 
	 set @v_sql=concat('update node set orderno=''',pro_rn,''' where pkid=''',pro_pkid,'''');
	 prepare stmt from @v_sql;
     execute stmt;        
     deallocate prepare stmt; 
	end if;
    UNTIL done  END REPEAT;
	close cur_no;
	drop table if exists coolink_orderno;
end;


