declare done INT DEFAULT 0;  
declare v_tablename varchar(128);
declare cur CURSOR for SELECT table_name FROM INFORMATION_SCHEMA.TABLES where table_schema='zcfggd';
DECLARE CONTINUE HANDLER FOR  not found  SET done = 1;
	open cur;
    repeat
    fetch cur into v_tablename;
    if not done then
        set @sql=concat('OPTIMIZE local TABLE ',v_tablename,';');
        prepare stmt from @sql;
        execute stmt;        
        deallocate prepare stmt;
        #set @sql=concat('analyze local TABLE ',v_tablename,';');
        #prepare stmt from @sql;
        #execute stmt;        
        #deallocate prepare stmt; 
   End if;
   UNTIL done  END REPEAT;
   Close cur;   
end;

